{
  $schema: 'https://docs.renovatebot.com/renovate-schema.json',
  extends: ['config:recommended'],
  schedule: ['every weekend'],
  packageRules: [
    {
      groupName: 'lint',
      matchPackageNames: [
        '@typescript-eslint/eslint-plugin',
        '@typescript-eslint/parser',
        'eslint',
        'eslint-config-prettier',
        'eslint-plugin-import',
        'eslint-plugin-react',
        'eslint-plugin-react-hooks',
        'eslint-plugin-sonarjs',
        // 'eslint-plugin-tailwindcss',
        'eslint-plugin-typescript-sort-keys',
        'eslint-plugin-unicorn',
        'prettier',
        'prettier-plugin-pkg',
        'prettier-plugin-tailwindcss',
        '@ianvs/prettier-plugin-sort-imports'
      ]
    },
    {
      groupName: 'latex',
      matchPackageNames: ['remark-math', 'rehype-katex']
    },
    {
      groupName: 'next',
      matchPackageNames: ['next', '@next/eslint-plugin-next']
    },
    {
      groupName: 'tailwindcss',
      matchPackageNames: [
        '@tailwindcss/cli',
        '@tailwindcss/postcss',
        'tailwindcss'
      ]
    }
  ],
  baseBranches: ['main']
}

{
  "$schema": "https://turbo.build/schema.json",
  "globalDependencies": ["pnpm-lock.yaml", "patches/*"],
  "tasks": {
    "build": {
      "dependsOn": [
        // Run `build` in workspaces I depend on first
        "^build"
      ],
      // Cache all files emitted to the packages's directories
      "outputs": ["dist/**", ".next/**", "public/_pagefind/**"]
    },
    "test": {
      "outputs": ["dist/**"]
    },
    "types:check": {
      "dependsOn": [
        // Run `build` in workspaces I depend on first
        "^build"
      ],
      "outputs": ["dist/**", ".next/**"]
    },
    "dev": {
      "dependsOn": [
        // Run `build` in workspaces I depend on first
        "^build"
      ],
      "cache": false
    }
  }
}
